import styled from 'styled-components';

import Card from './comps/card';

const HeaderWrapper = styled('div')`
  margin: 30px;
  font-size: 28px;
  font-weight: bold;
  color: brown;
  text-align: center;
`

export default function App() {
  return (
    <>
      <HeaderWrapper>COWIN SLOTS</HeaderWrapper>

    </>
  );
}
